import './App.css';
import Button from "./Components/Button";

function App() {
  return (
    <div className="App">

     <div className="button-box">
     <Button className=".style-button" sign={"+"}/>
     <Button className=".style-button" sign={"-"}/>
     </div>
    </div>
  );
}

export default App;
